column8:
強力ゲキタイくんは天然素材で安心！安全！<br>田や畑・倉庫に、イノシシ・シカ・ヘビ・モグラ・ネズミ・イヌ・ネコ等寄せ付けません。<br>使用方法　<br>●イノシシ・シカ・ヘビ・イタチ・キツネ等は、畑・田との境界線に大さじ１杯ずつ約２m間隔に置きます。<br>●モグラは、畝の谷間に大さじ１杯ずつ約２m間隔に置きます。<br>●ネズミ等は、農業倉庫・屋根裏の中心部から始め、徐々に置く場所を外へ広げていきます。<br><br>効果　約２ヶ月（使用状況によって異なります。）<br>容量　１リットル<br>成分　木タール・木酢液・ニンニク・その他天然素材<style type="text/css">
